// @ts-nocheck

import React from "react";

// Customizable Area Start
import { filled, img1, img2, img3 } from "./assets";

import "./EmailAccountLogin.css";
import { withRouter } from "react-router-dom";
//@ts-ignore
// Customizable Area End

import EmailAccountLoginController, {
  Props
} from "./EmailAccountLoginController.web";

class EmailAcountLoginBlockEmailSignin extends EmailAccountLoginController {
  // Customizable Area Start
  // Customizable Area End

  constructor(props: Props) {
    super(props);
    // Customizable Area Start
    // Customizable Area End
  }

  render() {
    return (
      <div className="outer-wrapper">
        <div className="upper-wrapper">
          <div className="">
            <div class="flex flex-wrap -mx-3 overflow-hidden sm:-mx-px md:-mx-3 lg:-mx-3 xl:-mx-3">
              <div class="my-3 px-3 w-1/3 overflow-hidden sm:my-px sm:px-px md:my-3 md:px-3 md:w-1/3 lg:my-3 lg:px-3 lg:w-1/3 xl:my-3 xl:px-3 xl:w-1/3">
                <div className="top-infomation">
                  <img src={img1} alt="" />
                  <h5 className="">Some Title Goes Here</h5>
                  <p>Some description goes here. Some description goes here.</p>
                </div>
              </div>

              <div class="my-3 px-3 w-1/3 overflow-hidden sm:my-px sm:px-px md:my-3 md:px-3 md:w-1/3 lg:my-3 lg:px-3 lg:w-1/3 xl:my-3 xl:px-3 xl:w-1/3">
                <div className="top-infomation">
                  <img src={img2} alt="" />
                  <h5 className="">Some Title Goes Here</h5>
                  <p>Some description goes here. Some description goes here.</p>
                </div>
              </div>

              <div class="my-3 px-3 w-1/3 overflow-hidden sm:my-px sm:px-px md:my-3 md:px-3 md:w-1/3 lg:my-3 lg:px-3 lg:w-1/3 xl:my-3 xl:px-3 xl:w-1/3">
                <div className="top-infomation">
                  <img src={img3} alt="" />
                  <h5 className="">Some Title Goes Here</h5>
                  <p>Some description goes here. Some description goes here.</p>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div className="botton-wrapper">
          <div className="inner-box">
            <h4 className="mb-4">
              Welcome to Subscriber Admin Sign In to get started
            </h4>
            <p className="sub-heading">Enter your email to continue</p>
            <form
              onSubmit={e => {
                e.preventDefault(), this.handleEmailLogin();
              }}
            >
              <div className="field-wrapper mb-8">
                <label>Email</label>
                <input
                  type="email"
                  placeholder="Enter Email id"
                  {...this.txtInputEmailProps}
                />
                <img src={filled} alt="" />
              </div>
              {this.state.errorEmail && (
                <div className="text-red-600 mb-3">{this.state.errorEmail}</div>
              )}
              <div className="">
                <button
                  type="submit"
                  className="button w-96 op-btn-primary mb-3"
                  // onClick={() => this.props.history.push("select-domain")}
                >
                  Next
                </button>
                <button
                  className="button w-96 op-btn-secondary"
                  onClick={() =>
                    this.props.history.push("email-account-signup")
                  }
                >
                  Create Account
                </button>
              </div>
            </form>
          </div>
        </div>
        <p className="copyright-info">copyright 2020 okyd</p>
      </div>
    );
  }
}

// Customizable Area Start

// Customizable Area End
export default withRouter(EmailAcountLoginBlockEmailSignin);
